export default class OperationResult<TResult> {
    success: boolean;
    message: string;
    result?: TResult;
    constructor(success: boolean, message: string, result?: TResult);
    static BuildSuccessResult<TResult>(message: string, reult: TResult): OperationResult<TResult>;
    static BuildFailur<TResult>(message: string): OperationResult<TResult>;
}
